import React from 'react';

import Member from './Member'

class Crew extends React.Component {
    
    render() {
        const members = this.props.members.map((name, index) => <Member key={index} name={name}/>)

        return(
            <div>
                {members}
            </div>
            
        )
        
    }
}

export default Crew;
